	}



}
async componentDidMount(){
	const  list = await window.localStorage.getItem('det');
	const parsedlist= JSON.parse(list);
	if(list == null){
		return false;
	}
	else{
		this.setState({list:parsedlist})
	}
	console.log(this.state.list);
